import { NavLink } from "react-router-dom";

const NavBar = (props) => {
  const { auth = false } = props;

  return (
    <div className="bg-dark">
      <div className="btn-group">
        <NavLink to="/" className="btn btn-dark" activeClassName="active">
          Inicio
        </NavLink>
        {true && (
          <NavLink
            to="/agenda"
            className="btn btn-dark"
            activeClassName="active"
          >
            Agenda
          </NavLink>
        )}
        {true && (
          <NavLink
            to="/signup"
            className="btn btn-dark"
            activeClassName="active"
          >
            Registo
          </NavLink>
        )}
        {true && (
          <NavLink
            to="/signin"
            className="btn btn-dark"
            activeClassName="active"
          >
            Ingresar
          </NavLink>
        )}
        <NavLink to="/check" className="btn btn-dark" activeClassName="active">
          Comprobar
        </NavLink>
        {auth && (
          <NavLink
            to="/check"
            className="btn btn-dark"
            activeClassName="active"
          >
            Logout
          </NavLink>
        )}
      </div>
    </div>
  );
};

export default NavBar;
